// src/pages/Gallery.js
import React from 'react';

function Gallery() {
  return (
    <div className="gallery">
      <h1>Galería de Sembrados</h1>
      <p>Aquí podrás ver imágenes de nuestros sembrados y actividades ecológicas.</p>
    </div>
  );
}

export default Gallery;
